(592, 282, 'information_0_information', '<h3 class=\"p1\">STATYTOJO ĮSIPAREIGOJIMAI</h3>\r\n<p class=\"p1\"><span class=\"s1\">Privačių UAB \"Mašida\" investuotojų lėšomis 6 ha teritorijoje bus įrengtas gatvių apšvietimas, vaizdo stebėjimo kameros, pakeliami automatiniai gyvenvietės kelio atitvarai, įrengta vaikų žaidimų aikštelė, apželdintos bendrosios gyvenvietės teritorijos, sutvarkytas parkas su laisvalaikio zonomis bei iškastas dekoratyvinis tvenkinys.</span></p>'),
(593, 282, '_information_0_information', 'field_6108eda9b5925'),
(594, 282, 'information_1_information', '<h3 class=\"p1\"><b>BENDROS ZONOS IR BENDRUOMENĖ</b></h3>\r\n<p class=\"p1\"><span class=\"s1\">Gyvenvietė BONAMO turi bendras žalias zonas: vaikų žaidimų aikštelę esančią šiaurinėje gyvenvietės dalyje (17,6 a), parką (74 a) ir inžinerinės infrastruktūros sklypus (71 a);</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Kiekvienas pirkėjas tampa jungtinės veiklos sutarties dalyviu ir/ar bendrijos nariu, numatomas kaupiamasis ir administracinis mokestis bendroms reikmėms;</span></p>'),
(595, 282, '_information_1_information', 'field_6108eda9b5925'),
