(621, 302, 'information_0_information', '<h3 class=\"p1\"><b>STATYTOJO ĮSIPAREIGOJIMAI</b></h3>\r\n<p class=\"p1\"><span class=\"s1\">Privačių UAB \"Mašida\" investuotojų lėšomis 6 ha teritorijoje bus įrengtas gatvių apšvietimas, vaizdo stebėjimo kameros, pakeliami automatiniai gyvenvietės kelio atitvarai, įrengta vaikų žaidimų aikštelė, apželdintos bendrosios gyvenvietės teritorijos, sutvarkytas parkas su laisvalaikio zonomis bei iškastas dekoratyvinis tvenkinys.</span></p>'),
